package Controlador.Servlets;

import Controlador.Objetos.Organizacion;
import Controlador.Objetos.Representante;
import Controlador.Procesos.AccionesOrganizacion;
import java.io.IOException;
import java.io.InputStream;
import java.io.PrintWriter;
import javax.servlet.RequestDispatcher;
import javax.servlet.ServletException;
import javax.servlet.annotation.MultipartConfig;
import javax.servlet.http.HttpServlet;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import javax.servlet.http.HttpSession;
import javax.servlet.http.Part;
import sun.misc.IOUtils;

@MultipartConfig(fileSizeThreshold=1024*1024*10, 	// 10 MB 
                 maxFileSize=1024*1024*50,      	// 50 MB
                 maxRequestSize=1024*1024*100)   	// 100 MB
public class RegistrarOrganizacion extends HttpServlet {

  protected void processRequest(HttpServletRequest request, HttpServletResponse response)
          throws ServletException, IOException {
    response.setContentType("text/html;charset=UTF-8");
  }

  @Override
  protected void doGet(HttpServletRequest request, HttpServletResponse response)
          throws ServletException, IOException {
    processRequest(request, response);
  }

  @Override
  protected void doPost(HttpServletRequest request, HttpServletResponse response)
          throws ServletException, IOException {
    processRequest(request, response);
    response.setContentType("text/html;charset=UTF-8");
    request.setCharacterEncoding("UTF-8"); 
    try (PrintWriter out = response.getWriter()) {
      int estado;
      Organizacion<String, Integer, Integer, Integer> org = new Organizacion();
      Representante r = new Representante();
      AccionesOrganizacion e = new AccionesOrganizacion();
      Part filePart = request.getPart("organizationPic");
      Part filePart1 = request.getPart("agentPic");
      InputStream inputStream;
      
      org.setNomOrg(request.getParameter("name"));
      org.setCatOrg(Integer.parseInt(request.getParameter("orgCategory")));
      org.setEmailOrg(request.getParameter("mail"));
      org.setTelOrg(request.getParameter("phone"));
      org.setDirUbiOrg(request.getParameter("location"));
      org.setCodPost(Integer.parseInt(request.getParameter("postalCode")));
      org.setEstUbiOrg(Integer.parseInt(request.getParameter("estate")));
      org.setMunUbiOrg(Integer.parseInt(request.getParameter("municipallity")));
      org.setPassOrg(request.getParameter("pass"));
      
      if(filePart != null) {
        inputStream = filePart.getInputStream();
        byte[] bytes = IOUtils.readFully(inputStream, -1, false);
        org.setFotOrg(java.util.Base64.getEncoder().encodeToString(bytes));
      }else {
        String organization = "";
        org.setFotOrg(organization);
      }
      
      r.setNomRep(request.getParameter("agentName"));
      r.setApePatRep(request.getParameter("agentSurname"));
      r.setEmailRep(request.getParameter("agentMail"));
      r.setCarRep(request.getParameter("agentCharge"));
      
      if(filePart != null) {
        inputStream = filePart.getInputStream();
        byte[] bytes = IOUtils.readFully(inputStream, -1, false);
        org.setFotOrg(java.util.Base64.getEncoder().encodeToString(bytes));
        System.out.println(org.getFotOrg());
      }else {
        String agent = "";
        r.setFotRep(agent);
        System.out.println(org.getFotOrg());
      }
      
      estado = e.registrarOrganizacion(org, r);
      HttpSession sesion = request.getSession(true);
      RequestDispatcher rd;
      
      switch(estado) {
        case -15:{
          request.setAttribute("msg", "Ya existe una cuenta asociada al correo ingresado");
          rd = request.getRequestDispatcher("registroOrganizacion.jsp");
          rd.forward(request, response);
          return;
        }
        case 0:{
          request.setAttribute("msg", "Ha ocurrido un problema con el servidor, intentalo más tarde");
          rd = request.getRequestDispatcher("registroOrganizacion.jsp");
          rd.forward(request, response);
          return;
        }
        case 1:{
          //TODO Consultar datos organizacion
          //sesion.setAttribute("sesionOrganizacion", org);
          //TODO inicioOrganizacion
          //TODO obtener toda la información del usuario
        }
      }
    }
  }

  @Override
  public String getServletInfo() {
    return "Short description";
  }
}
